package club.dlblog.sqlite.entity;import java.time.LocalDateTime;public class ProEntity {    private Integer id;    private String databaseKey;    private String databaseUrl;    private LocalDateTime createTime;    public Integer getId() {        return id;    }    public void setId(Integer id) {        this.id = id;    }    public String getDatabaseKey() {        return databaseKey;    }    public void setDatabaseKey(String databaseKey) {        this.databaseKey = databaseKey;    }    public String getDatabaseUrl() {        return databaseUrl;    }    public void setDatabaseUrl(String databaseUrl) {        this.databaseUrl = databaseUrl;    }    public LocalDateTime getCreateTime() {        return createTime;    }    public void setCreateTime(LocalDateTime createTime) {        this.createTime = createTime;    }}